import React from 'react';
import TabSwitchContainer from './tab-switch-container';
import AggregatedStatsContainer from './AgreggatedStatsContainer';
import AveragesContainer from './averages-container';

const MainContentContainer = ({ data }) => {
    const [state, setState] = React.useState({
        tab: 'global',
    });

    const handleTabChange = React.useCallback((newValue) => {
        setState({
            tab: newValue,
        });
    }, []);

    return (
        <TabSwitchContainer onChange={handleTabChange} currentTab={state.tab} tabList={Object.keys(data)}>
            <AggregatedStatsContainer data={data[state.tab]} />
        </TabSwitchContainer>
    );
}

export default MainContentContainer;
